import React from 'react';
import PropTypes from 'prop-types';

const NetBackboard = (props) => {
  return (
    <rect
      x={props.position.x}
      y={props.position.y}
      rx={20}
      ry={20}
      width={200}
      height={200}
      style={props.style}
    />
  );
};

export default NetBackboard;
